import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Navbar from "./components/Navbar";
import Herosection from "./components/Herosection";
import "./App.css";

function App() {
  return (
<Router>
<div>
      <Navbar />
      <Herosection />
    </div>
</Router>
  );
}

export default App;
